import React from "react";
import * as S from './Header.style'

const Header = (props) => {
    const {
        title,
    } = props;

    return (
        <React.Fragment>
            <S.Header>
                <h1>{title}</h1>
            </S.Header>
        </React.Fragment>
    )
};

export default Header;
